//ajax form
var options_ajax={
    beforeSubmit:  showRequest_ajax,  // pre-submit callback
    success:       showResponse_ajax
};

function showRequest_ajax(formData, jqForm, options){
    var error=false;
    var formElementId = $(jqForm[0]).attr("id");
    if ($('#'+formElementId).find(".agree_checkbox").length) {
        if (!$('#'+formElementId).find(".agree_checkbox").is(":checked")) {
            error=true;
            Swal.fire({
                type: 'warning',
                title: 'Внимание',
                text: 'Пожалуйста, подтвердите согласие с обработкой персональных данных'
            })
        }
    }
    if (!error) {
        var preloader="<img src='/local/templates/main/assets/images/preloader.svg' id='preloader_ajax'>";
        $('#'+formElementId).find('.feedback_result').html(preloader).css("opacity",1);
    }
    else{
        return false;
    }
}
function showResponse_ajax(responseText, statusText, xhr, $form){    
    console.log(responseText);
    $('#preloader_ajax').remove();
    var formElementId = $($form[0]).attr("id");
    var obj = jQuery.parseJSON(responseText);
    if(obj.status=="error"){
        var res_text="<span class='error'>"+obj.text+"</span>";
        $('#'+formElementId+' .feedback_result').html(res_text)
    }
    else{

        var yametka=$('#'+formElementId).data("yametka");
        if (yametka) {
            setAnalyticsGoal(yametka);
        }
        var rs=$('#'+formElementId).data("roistat");
        if (rs) {
            setAnalyticRoistat(rs);
        }

        $('#'+formElementId+" textarea,input[type='text']").val('');
        var res_text="<span class='success'>"+obj.text+"</span>";
        $('#'+formElementId+' .feedback_result').html(res_text)
    }
}

