function calculate()
{
    var house_price=Math.round(parseFloat($('#house_price').val()/* *1000000 */));
    console.log(house_price);
    var first_vznos=Math.round(parseFloat($('#first_vznos').val()/* *1000000 */));
    var kredit_sum=house_price-first_vznos;
    if ($('#mat_capital_check').is(":checked")) {
        kredit_sum-=parseInt($('#mat_capital').val());
        $('#need_mater').val("Да");
    }
    else{
        $('#need_mater').val("Нет");
    }



    $('#kredit_sum').text(number_format(kredit_sum,0,""," "));
    $('#kredit_sum_hidden').val(number_format(kredit_sum,0,""," "));
    if ($('#calc_type').val=="дом") {
        var percent=$('#percent_house').val();
    }
    else{
        var percent=$('#percent_land').val();
    }
    if ($('#gos_check').is(":checked")) {
        percent=parseInt($('#gos').val());
        $('#need_gos').val("Да");
    }
    else{
        $('#need_gos').val("Нет");
    }
    var srok=parseInt($('#srok').val());
    var monthPercent=percent/100/12;
    var tmp=Math.pow((1+monthPercent),(srok*12));
    var monthPayment=Math.round((kredit_sum*monthPercent*tmp)/(tmp-1));
    $('#need_doxod').text(number_format(monthPayment*2,0,""," "));
    $('#monthPayment').text(number_format(monthPayment,0,""," "));
    $('#monthPayment_hidden').val(monthPayment);
    $('#percent_stavka').text(percent+"%");
    $('#calcPercent_hidden').val(percent);
}



function number_format( number, decimals, dec_point, thousands_sep ) {	// Format a number with grouped thousands
	//
	// +   original by: Jonas Raoni Soares Silva (http://www.jsfromhell.com)
	// +   improved by: Kevin van Zonneveld (http://kevin.vanzonneveld.net)
	// +	 bugfix by: Michael White (http://crestidg.com)

	var i, j, kw, kd, km;

	// input sanitation & defaults
	if( isNaN(decimals = Math.abs(decimals)) ){
		decimals = 2;
	}
	if( dec_point == undefined ){
		dec_point = ",";
	}
	if( thousands_sep == undefined ){
		thousands_sep = ".";
	}

	i = parseInt(number = (+number || 0).toFixed(decimals)) + "";

	if( (j = i.length) > 3 ){
		j = j % 3;
	} else{
		j = 0;
	}

	km = (j ? i.substr(0, j) + thousands_sep : "");
	kw = i.substr(j).replace(/(\d{3})(?=\d)/g, "$1" + thousands_sep);
	//kd = (decimals ? dec_point + Math.abs(number - i).toFixed(decimals).slice(2) : "");
	kd = (decimals ? dec_point + Math.abs(number - i).toFixed(decimals).replace(/-/, 0).slice(2) : "");


	return km + kw + kd;
}

